import React from "react";
import Header from "./commonResource/Component/Header";
import footer from ""
import SectionOne from "./commonResource/Component/SectionOne";
import SectionTwo from "./commonResource/Component/SectionTwo";
import SectionThree from "./commonResource/Component/SectionThree";
import SectionFour from "./commonResource/Component/SectionFour";
import SectionFive from "./commonResource/Component/SectionFive";
import SectionSix from "./commonResource/Component/SectionSix";


import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
